import './nav.css';
import logo from './logo.png'
import { Link } from 'react-router-dom';

function Navbar() {

  return (
    <>
      <div className='nav_container'>
        <div className='nav__logo'>
          VKEdu
        </div>
        <div>
          <Link to='#'>Home</Link>
          <Link to='#'>About</Link>
          <Link to='#'>Courses</Link>
          <Link to='#'>Contact Us</Link>
        </div>
      </div>
      {/* <Category /> */}
    </>
  )
}

export default Navbar;

